// Formatear precio
function formatPrice(price, currency = 1) {
    if (!price || price === null || price === 'null') {
        return 'Consultar precio';
    }
    
    const priceNum = parseFloat(price);
    if (isNaN(priceNum)) {
        return 'Consultar precio';
    }
    
    const currencySymbol = currency === 1 ? 'S/' : currency === 2 ? '$' : '€';
    return `${currencySymbol} ${priceNum.toFixed(2)}`;
}

// Formatear stock
function formatStock(stock) {
    const stockNum = parseFloat(stock) || 0;
    if (stockNum > 10) {
        return { text: `Stock: ${stockNum}`, class: 'stock-available' };
    } else if (stockNum > 0) {
        return { text: `Stock: ${stockNum}`, class: 'stock-low' };
    } else {
        return { text: 'Sin stock', class: 'stock-out' };
    }
}

// Renderizar productos
