// Actualizar botón "Ver más"
function updateLoadMoreButton() {
    let loadMoreContainer = document.getElementById('loadMoreContainer');
    
    // Si no existe, crear el contenedor
    if (!loadMoreContainer) {
        loadMoreContainer = document.createElement('div');
        loadMoreContainer.id = 'loadMoreContainer';
        loadMoreContainer.className = 'load-more-container';
        productsGrid.parentElement.appendChild(loadMoreContainer);
    }
    
    // Mostrar u ocultar según haya más productos
    if (displayedProductsCount < filteredProducts.length) {
        const remaining = filteredProducts.length - displayedProductsCount;
        loadMoreContainer.innerHTML = `
            <button class="btn-load-more" onclick="loadMoreProducts()">
                Ver más (${remaining} productos restantes)
            </button>
        `;
        loadMoreContainer.style.display = 'block';
    } else {
        loadMoreContainer.style.display = 'none';
    }
}

// Cargar más productos
function loadMoreProducts() {
    displayedProductsCount += PRODUCTS_PER_PAGE;
    renderProducts();
}

// Actualizar contador de productos
function updateProductCount() {
    const count = filteredProducts.length;
    const showing = Math.min(displayedProductsCount, filteredProducts.length);
    productCount.textContent = `Mostrando ${showing} de ${count} producto${count !== 1 ? 's' : ''}`;
}

// Filtrar productos
function filterProducts() {
    const searchTerm = searchInput.value.toLowerCase().trim();
    const selectedCategory = categoryFilter.value;
    const selectedStock = stockFilter.value;
    const selectedFeatured = featuredFilter.value;
    
    // Reset al filtrar
    displayedProductsCount = PRODUCTS_PER_PAGE;
    
    filteredProducts = allProducts.filter(product => {
        // Búsqueda por texto
        const name = (product['DESCRIPCIÓN'] || '').toLowerCase();
        const code = (product.code || product['CODIGO INTERNO'] || '').toString().toLowerCase();
        const category = (product['DESCRIPCIÓN DE CATEGORÍA'] || '').toLowerCase();
        
        const matchesSearch = !searchTerm || 
            name.includes(searchTerm) || 
            code.includes(searchTerm) ||
            category.includes(searchTerm);
        
        // Filtro por categoría
        const matchesCategory = !selectedCategory || 
            product['DESCRIPCIÓN DE CATEGORÍA'] === selectedCategory;
        
        // Filtro por stock
        const stock = parseFloat(product['STOCK ACTUAL DISPONIBLE']) || 0;
        let matchesStock = true;
        if (selectedStock === 'available') {
            matchesStock = stock > 0;
        } else if (selectedStock === 'out') {
            matchesStock = stock <= 0;
        }
        
        // Filtro por destacados
        const featured = product['DESTACADO'] === 'SI' || product['DESTACADO'] === 'SÍ';
        const matchesFeatured = !selectedFeatured || 
            (selectedFeatured === 'yes' && featured);
        
        // Solo mostrar productos con imagen
        const hasImage = product.has_image && product.image_path;
        
        return matchesSearch && matchesCategory && matchesStock && matchesFeatured && hasImage;
    });
    
    renderProducts();
    updateProductCount();
}

